import React from 'react';
import Producto from './componentes/producto';
import {Container,Row} from "reactstrap";
import './App.css';
import Navegacion from './componentes/navegacion';

class App extends React.Component{
  render(){
    return (
      <Container className="body">
        <header>
          <Navegacion logo="https://icon-icons.com/icons2/1526/PNG/72/shop_106574.png" titulo="Facherita's Store"/>
        </header>
        <content>
        <Row>
          <Producto titulo = "Audifonos facheros" marca="Motorola®" precio="22.000" imagen="https://static8.depositphotos.com/1000992/960/i/950/depositphotos_9605409-stock-photo-headphones-isolated-on-white.jpg" descripcion=""/>
          <Producto titulo = "Tarjeta de memoria osi" marca="Kingstong®" precio="59.999" imagen="https://st.depositphotos.com/1868917/3253/v/450/depositphotos_32534683-stock-illustration-memory-card-set.jpg" descripcion=""/>
          <Producto titulo = "Pendrai con musica" marca="HP®" precio="10.990" imagen="https://st2.depositphotos.com/2211028/6988/i/950/depositphotos_69885181-stock-photo-hand-inserting-usb-memory-stick.jpg" descripcion=""/>
          <Producto titulo = "Altos parlantes señora" marca="Kioto®" precio="201.990" imagen="https://st2.depositphotos.com/1063296/8338/i/950/depositphotos_83385172-stock-photo-loudspeakers-stacked.jpg" descripcion=""/>
          <Producto titulo = "Audifonos facheros" marca="Motorola®" precio="22.000" imagen="https://static8.depositphotos.com/1000992/960/i/950/depositphotos_9605409-stock-photo-headphones-isolated-on-white.jpg" descripcion=""/>
          <Producto titulo = "Tarjeta de memoria osi" marca="Kingstong®" precio="59.999" imagen="https://st.depositphotos.com/1868917/3253/v/450/depositphotos_32534683-stock-illustration-memory-card-set.jpg" descripcion=""/>
          <Producto titulo = "Pendrai con musica" marca="HP®" precio="10.990" imagen="https://st2.depositphotos.com/2211028/6988/i/950/depositphotos_69885181-stock-photo-hand-inserting-usb-memory-stick.jpg" descripcion=""/>
          <Producto titulo = "Altos parlantes señora" marca="Kioto®" precio="201.990" imagen="https://st2.depositphotos.com/1063296/8338/i/950/depositphotos_83385172-stock-photo-loudspeakers-stacked.jpg" descripcion=""/>
        </Row>
        </content>
      </Container>
    );
  }
}

export default App;
